import React from 'react'
import '../styles/Output.css'

const Output = props => {
    return(
        <div className='OutputWrapper'>
            { props.bits.map((bit, i) => <span className='Bits' key={ i }>{ bit }</span>) }
        </div>
    )
}

export default Output
